import React from 'react';
//import logo from './logo.svg';
import './App.css';
import * as ventas from './ventas';
interface IState {
  valores:string|string[]
}
class App extends React.Component<{},IState> {
  constructor(props:any) {
      super(props);
      this.state={
        valores:ventas.texto
      }

  }
  render(){
    return(<div>
      {this.state.valores}
    </div>)
  }
}

export default App;
